/*

Given a string S, consider all duplicated substrings: (contiguous) substrings of S that occur 2 or more times.  (The occurrences may overlap.)

Return any duplicated substring that has the longest possible length.  (If S does not have a duplicated substring, the answer is "".)



Example 1:

Input: "banana"
Output: "ana"
Example 2:

Input: "abcd"
Output: ""


Note:

2 <= S.length <= 10^5
S consists of lowercase English letters.

 */
package binarysearch.hard;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class LongestDuplicatedSubstring {

    private int radix=26;
    private long mod =(int)Math.pow(2,31)-1;
    public String longestDupSubstring(String S) {
        int small = 0;
        int large = S.length()-1;
        String res="";
        while(small<=large) {
            int mid = small+(large-small)/2;
            String duplicate = duplicate(S,mid);
            if(!duplicate.equals("")) {
                res = duplicate;
                small=mid+1;
            } else {
                large=mid-1;
            }
        }
        return res;
    }

    private String duplicate(String S,int mid) {
        Map<Long, List<Integer>> map = new HashMap<>();
        String sub = S.substring(0,mid);
        long hash = getHash(sub);
        map.put(hash,new ArrayList<>());
        map.get(hash).add(0);
        long factor = getMultiplyFactor(mid);
        for(int i=1; i<S.length()-mid+1; i++){
            hash = ((hash + mod - factor * S.charAt(i-1) % mod) * radix + S.charAt(i+mid-1)) % mod;
            if(map.containsKey(hash)){
                for(int start : map.get(hash)){
                    String substring = S.substring(i, i + mid);
                    if(S.substring(start,start+mid).equals(substring))  {
                        return substring;
                    }
                }
            }
            else{
                map.put(hash,new ArrayList<>());
            }
            map.get(hash).add(i);
        }
        return "";
    }

    private long getMultiplyFactor(int m) {
        long h=1;
        for (int i=0;i<m-1;i++) {
            h=(h*radix)% mod;
        }
        return h;
    }

    private long getHash(String s) {
        long x=0;
        for (int i=0;i<s.length();i++) {
            x = (radix*x + s.charAt(i))% mod;
        }
        return x;
    }

    public static void main(String[] args) {
        System.out.println(new LongestDuplicatedSubstring().
                longestDupSubstring(""));
    }

}

/*

Binary Search in range 1 and N, so it's O(logN)
Rolling hash O(N)
Overall O(NlogN)
SpaceO(N)

Using Rabin Karp.

 */